column8:
ちょっとした修理から、本格的な工作まで、様々な用途で使用できる工具のセット。コンパクトに収納ができるので、持ち運びにも便利です。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ちょっとした修理から、本格的な工作まで、様々な用途で使用できる工具のセット。コンパクトに収納ができるので、持ち運びにも便利です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">約320×225×60mm</font><br><font color="#333333" size="-1">個装サイズ：33×23×7cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約2000g</font><br><font color="#333333" size="-1">個装重量：2100g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ケース:PET</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">六角レンチ×8、ビット×10、ラジオペンチ、ニッパー、ハンマー、ビットドライバー、メジャー(3m用)、精密ドライバー(+)×2、精密ドライバー(-)×2、カッター、コンビネーションレンチ×3、ドライバー(+)(小)、ドライバー(+)(大)、ドライバー(-)(小)、ドライバー(-)(大)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">台湾、中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
